import React, { useEffect } from "react";
import { get } from "../utils/pedidos";

export default function SearchText() {
  useEffect(() => {
    get("/search/multi/batman").then((res) => console.log(res));
  }, []);

  return (
    <div>
      <form>
        <input type="text" />
        <button type="submit">Buscar</button>
      </form>
    </div>
  );
}
